import React  from "react"

class UserSignupPage extends React.Component{

    render(){

        return(

            <form>
                <h1>Sign Up</h1> 
                <div>
                    <label>Username</label>
                    <input/>
                </div>
                <div>
                    <label>
                        DisplayName
                    </label>
                    <input/>
                </div>
            </form>
           
        )
    }

}

export default UserSignupPage;
